import React, { useState, useEffect } from "react";
import "../styles/Home.css";
import { FaLinkedin, FaGithub, FaInstagram } from "react-icons/fa";

const Home = () => {
  const [stockData, setStockData] = useState({
    symbol: "AAPL",
    price: "—",
    change: "—",
    changePercent: "—",
  });

  const [currencyData, setCurrencyData] = useState({
    base: "EUR",
    rates: { USD: "—", GBP: "—", PKR: "—" },
  });

  // Fetch currency rates
  useEffect(() => {
    fetch("http://127.0.0.1:5000/api/currency")
      .then((res) => res.json())
      .then((data) => {
        if (data && data.rates) {
          setCurrencyData({
            base: data.base,
            rates: {
              USD: data.rates.USD,
              GBP: data.rates.GBP,
              PKR: data.rates.PKR,
            },
          });
        }
      })
      .catch((err) => console.error("Error fetching currency:", err));
  }, []);

  // Fetch stock data
  useEffect(() => {
    fetch("http://127.0.0.1:5000/api/stock")
      .then((res) => res.json())
      .then((data) => setStockData(data))
      .catch((err) => console.error("Error fetching stock:", err));
  }, []);

  return (
    <div className="home-container">
      {/* Hero Section */}
      <div className="hero">
        <div className="hero-left">
          <img
            src="https://via.placeholder.com/250x250.png?text=Profile+Photo"
            alt="Profile"
            className="profile-img"
          />
        </div>

        <div className="hero-right">
          <h3>Hello, Myself</h3>
          <h1>M. Talha Faizan</h1>
          <h2>
            And I'm a <span className="highlight">Web Developer and ML Engineer</span>
          </h2>
          <p>
            I am a passionate Web Developer and have a keen interest in AI/ML Engineering. 
            I love building creative and efficient solutions that bridge the gap between 
            modern web technologies and intelligent systems. Always eager to learn and 
            explore new challenges in the tech world.
          </p>

          {/* Social Icons */}
          <div className="social-icons">
            <a href="https://www.linkedin.com/in/m-talha-faizan-46158532a/" target="_blank" rel="noopener noreferrer">
              <FaLinkedin />
            </a>
            <a href="https://github.com/talha-xml" target="_blank" rel="noopener noreferrer">
              <FaGithub />
            </a>
            <a href="https://www.instagram.com/not.mtf/" target="_blank" rel="noopener noreferrer">
              <FaInstagram />
            </a>
          </div>
        </div>
      </div>

      {/* API Dashboards */}
      <div className="dashboard-container">
        <div className="dashboard-section">
          <h2>Stock Market</h2>
          <div className="card">
            <p><strong>Symbol:</strong> {stockData.symbol}</p>
            <p><strong>Price:</strong> {stockData.price}</p>
            <p><strong>Change:</strong> {stockData.change} ({stockData.changePercent})</p>
          </div>
        </div>

        <div className="dashboard-section">
          <h2>Currency Rates (Base: {currencyData.base})</h2>
          <div className="card">
            <p><strong>USD:</strong> {currencyData.rates.USD}</p>
            <p><strong>GBP:</strong> {currencyData.rates.GBP}</p>
            <p><strong>PKR:</strong> {currencyData.rates.PKR}</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
